import React from 'react'

function ShowResults({ max, emoji }) {
  return (
    <div>{emoji.map(({id, emojiCode, counter}) => {
        if(counter === max) {
            return (
                <div key={id}>
                <button className="emoji" onClick={() => counterHandler(id)}>{String.fromCodePoint(emojiCode)}</button>
                <span>{counter}</span>
                </div>
            );
        }
    })}</div>
  )
}

export default ShowResults
